// ============ –£–¢–ò–õ–ò–¢–´ –î–õ–Ø –†–ê–ë–û–¢–´ –° –¶–ï–ù–ê–ú–ò ============
const PriceUtils = {
    // –ü–æ–ª—É—á–∏—Ç—å –≤—Å–µ –¥–æ—Å—Ç—É–ø–Ω—ã–µ —Ä–µ–≥–∏–æ–Ω—ã
    getRegions: function() {
        return Object.keys(priceData).sort();
    },
    
    // –ü–æ–ª—É—á–∏—Ç—å –≤—Å–µ –¥–æ—Å—Ç—É–ø–Ω—ã–µ —Ä–∞–∑–º–µ—Ä—ã –¥–ª—è —Ä–µ–≥–∏–æ–Ω–∞
    getSizesForRegion: function(region) {
        if (priceData[region]) {
            return Object.keys(priceData[region]).sort();
        }
        return [];
    },
    
    // –ü–æ–ª—É—á–∏—Ç—å –≤—Å–µ —á–∞—Å—Ç–æ—Ç—ã –¥–ª—è —Ä–µ–≥–∏–æ–Ω–∞ –∏ —Ä–∞–∑–º–µ—Ä–∞
    getFrequenciesForSize: function(region, size) {
        if (priceData[region] && priceData[region][size]) {
            return Object.keys(priceData[region][size]).sort();
        }
        return [];
    },
    
    // –ü–æ–ª—É—á–∏—Ç—å —Ü–µ–Ω—É –¥–ª—è –∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ–π –∫–æ–º–±–∏–Ω–∞—Ü–∏–∏
    getPrice: function(region, size, frequency) {
        if (priceData[region] && 
            priceData[region][size] && 
            priceData[region][size][frequency]) {
            return priceData[region][size][frequency];
        }
        return 0;
    },
    
    // –†–∞—Å—Å—á–∏—Ç–∞—Ç—å —Å—Ç–æ–∏–º–æ—Å—Ç—å –∑–∞ –º–µ—Å—è—Ü
    calculateMonthlyCost: function(region, size, frequency, quantity = 1) {
        const pricePerReplacement = this.getPrice(region, size, frequency);
        let replacements = 4; // –ü–æ —É–º–æ–ª—á–∞–Ω–∏—é 1 —Ä–∞–∑ –≤ –Ω–µ–¥–µ–ª—é
        
        if (frequency.includes('1 —Ä–∞–∑ –≤ –¥–≤–µ –Ω–µ–¥–µ–ª–∏')) replacements = 2;
        else if (frequency.includes('1 —Ä–∞–∑ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 4;
        else if (frequency.includes('2 —Ä–∞–∑–∞ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 8;
        else if (frequency.includes('3 —Ä–∞–∑–∞ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 12;
        else if (frequency.includes('4 —Ä–∞–∑–∞ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 16;
        else if (frequency.includes('5 —Ä–∞–∑ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 20;
        else if (frequency.includes('6 —Ä–∞–∑ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 24;
        else if (frequency.includes('7 —Ä–∞–∑ –≤ –Ω–µ–¥–µ–ª—é')) replacements = 28;
        
        return pricePerReplacement * replacements * quantity;
    },
    
    // –§–æ—Ä–º–∞—Ç–∏—Ä–æ–≤–∞—Ç—å —Ü–µ–Ω—É
    formatPrice: function(price) {
        return new Intl.NumberFormat('ru-RU', {
            style: 'currency',
            currency: 'RUB',
            minimumFractionDigits: 0,
            maximumFractionDigits: 0
        }).format(price);
    }
};

// –≠–∫—Å–ø–æ—Ä—Ç –¥–ª—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –≤ –¥—Ä—É–≥–∏—Ö —Å–∫—Ä–∏–ø—Ç–∞—Ö
if (typeof window !== 'undefined') {
    window.priceData = priceData;
    window.PriceUtils = PriceUtils;
    
    console.log('‚úÖ prices.js –∑–∞–≥—Ä—É–∂–µ–Ω —É—Å–ø–µ—à–Ω–æ! –í–µ—Ä—Å–∏—è 7.0');
    console.log('üìä –†–µ–≥–∏–æ–Ω–æ–≤:', PriceUtils.getRegions().length);
    console.log('üì¶ –†–∞–∑–º–µ—Ä—ã –¥–ª—è –ú–æ—Å–∫–≤—ã:', PriceUtils.getSizesForRegion("–ú–æ—Å–∫–≤–∞"));
}

// –ü–æ–¥—Å—á–µ—Ç –æ–±—â–µ–≥–æ –∫–æ–ª–∏—á–µ—Å—Ç–≤–∞ –ø–æ–∑–∏—Ü–∏–π
function countTotalPositions() {
    let total = 0;
    Object.keys(priceData).forEach(region => {
        Object.keys(priceData[region]).forEach(size => {
            total += Object.keys(priceData[region][size]).length;
        });
    });
    return total;
}

console.log('üî¢ –û–±—â–µ–µ –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –ø–æ–∑–∏—Ü–∏–π:', countTotalPositions());